import React from "react";
import { Page, Text, Viewer, Document } from '@react-pdf/renderer';
import { RPConfig, RPProvider, RPDefaultLayout, RPPages } from "@pdf-viewer/react";

function LectionPage() {
  return (
    <div>
      <RPConfig>
        <RPProvider src="test.pdf">
          <RPDefaultLayout>
              <RPPages />
          </RPDefaultLayout>
        </RPProvider>
      </RPConfig>
    </div>
  );
}

export default LectionPage;
